  "inlineSchema": "// Boom Informatique Store - Prisma Schema\n// E-commerce database schema for computer hardware and software store\n\ngenerator client {\n  provider = \"prisma-client\"\n  output   = \"../lib/generated\"\n}\n\ndatasource db {\n  provider = \"postgresql\"\n  url      = env(\"DATABASE_URL\")\n}\n\n// User management\nmodel User {\n  id        String   @id @default(cuid())\n  email     String   @unique\n  name      String?\n  password  String\n  role      Role     @default(CUSTOMER)\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relations\n  orders    Order[]\n  cart      Cart?\n  addresses Address[]\n\n  @@map(\"users\")\n}\n\nmodel Address {\n  id         String      @id @default(cuid())\n  userId     String\n  type       AddressType\n  street     String\n  city       String\n  state      String?\n  postalCode String\n  country    String      @default(\"France\")\n  isDefault  Boolean     @default(false)\n\n  // Relations\n  user User @relation(fields: [userId], references: [id], onDelete: Cascade)\n\n  @@map(\"addresses\")\n}\n\n// Product management\nmodel Category {\n  id          String   @id @default(cuid())\n  name        String   @unique\n  description String?\n  slug        String   @unique\n  image       String?\n  parentId    String?\n  createdAt   DateTime @default(now())\n  updatedAt   DateTime @updatedAt\n\n  // Relations\n  parent   Category?  @relation(\"CategoryHierarchy\", fields: [parentId], references: [id])\n  children Category[] @relation(\"CategoryHierarchy\")\n  products Product[]\n\n  @@map(\"categories\")\n}\n\nmodel Product {\n  id           String   @id @default(cuid())\n  name         String\n  description  String?\n  slug         String   @unique\n  sku          String   @unique\n  price        Decimal  @db.Decimal(10, 2)\n  comparePrice Decimal? @db.Decimal(10, 2)\n  costPrice    Decimal? @db.Decimal(10, 2)\n  stock        Int      @default(0)\n  minStock     Int      @default(0)\n  isActive     Boolean  @default(true)\n  isFeatured   Boolean  @default(false)\n  weight       Decimal? @db.Decimal(8, 2)\n  dimensions   String?\n  brand        String?\n  warranty     String?\n  createdAt    DateTime @default(now())\n  updatedAt    DateTime @updatedAt\n\n  // Relations\n  categoryId String\n  category   Category         @relation(fields: [categoryId], references: [id])\n  images     ProductImage[]\n  variants   ProductVariant[]\n  orderItems OrderItem[]\n  cartItems  CartItem[]\n\n  @@map(\"products\")\n}\n\nmodel ProductImage {\n  id        String  @id @default(cuid())\n  productId String\n  url       String\n  alt       String?\n  isPrimary Boolean @default(false)\n  order     Int     @default(0)\n\n  // Relations\n  product Product @relation(fields: [productId], references: [id], onDelete: Cascade)\n\n  @@map(\"product_images\")\n}\n\nmodel ProductVariant {\n  id        String   @id @default(cuid())\n  productId String\n  name      String // e.g., \"Color\", \"Size\", \"Storage\"\n  value     String // e.g., \"Red\", \"Large\", \"256GB\"\n  sku       String?\n  price     Decimal? @db.Decimal(10, 2)\n  stock     Int      @default(0)\n\n  // Relations\n  product Product @relation(fields: [productId], references: [id], onDelete: Cascade)\n\n  @@map(\"product_variants\")\n}\n\n// Order management\nmodel Order {\n  id          String      @id @default(cuid())\n  userId      String\n  orderNumber String      @unique @default(cuid())\n  status      OrderStatus @default(PENDING)\n  total       Decimal     @db.Decimal(10, 2)\n  subtotal    Decimal     @db.Decimal(10, 2)\n  tax         Decimal     @default(0) @db.Decimal(10, 2)\n  shipping    Decimal     @default(0) @db.Decimal(10, 2)\n  discount    Decimal     @default(0) @db.Decimal(10, 2)\n\n  // Shipping address\n  shippingStreet     String\n  shippingCity       String\n  shippingState      String?\n  shippingPostalCode String\n  shippingCountry    String  @default(\"France\")\n\n  // Billing address (optional, defaults to shipping)\n  billingStreet     String?\n  billingCity       String?\n  billingState      String?\n  billingPostalCode String?\n  billingCountry    String?\n\n  notes     String?\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relations\n  user  User        @relation(fields: [userId], references: [id])\n  items OrderItem[]\n\n  @@map(\"orders\")\n}\n\nmodel OrderItem {\n  id        String  @id @default(cuid())\n  orderId   String\n  productId String\n  quantity  Int\n  price     Decimal @db.Decimal(10, 2) // Price at time of order\n  total     Decimal @db.Decimal(10, 2)\n\n  // Relations\n  order   Order   @relation(fields: [orderId], references: [id], onDelete: Cascade)\n  product Product @relation(fields: [productId], references: [id])\n\n  @@map(\"order_items\")\n}\n\n// Shopping cart\nmodel Cart {\n  id        String   @id @default(cuid())\n  userId    String   @unique\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relations\n  user  User       @relation(fields: [userId], references: [id], onDelete: Cascade)\n  items CartItem[]\n\n  @@map(\"carts\")\n}\n\nmodel CartItem {\n  id        String @id @default(cuid())\n  cartId    String\n  productId String\n  quantity  Int    @default(1)\n\n  // Relations\n  cart    Cart    @relation(fields: [cartId], references: [id], onDelete: Cascade)\n  product Product @relation(fields: [productId], references: [id])\n\n  @@map(\"cart_items\")\n}\n\n// Enums\nenum Role {\n  CUSTOMER\n  ADMIN\n  MANAGER\n}\n\nenum AddressType {\n  SHIPPING\n  BILLING\n}\n\nenum OrderStatus {\n  PENDING\n  CONFIRMED\n  PROCESSING\n  SHIPPED\n  DELIVERED\n  CANCELLED\n  REFUNDED\n}\n",
